function reverseString(word) {
  const new_word = [];
  const array_chars = word.split("");
  const last_index = array_chars.length - 1;

  for (let i = 0; i <= Math.ceil(array_chars.length/2); i++) {
    new_word[last_index - i] = array_chars[i];
    new_word[i] = array_chars[last_index - i]
  }

  return new_word.join("");
}

package hw5;

import java.util.Scanner;

public class EditDistance {
    private static final int MATCH = 0;
    private static final int INSERT = 1;
    private static final int DELETE = 2;

    private final Scanner input;
    private String from, to;

    private Cell[][] matrix;

    private class Cell {
        int type;
        int cost;
    }

    public EditDistance() {
        this.input = new Scanner(System.in);
        getInput(input);

        this.matrix = new Cell[from.length() * 2][to.length() * 2];
        for(int r = 0; r < from.length(); r++) {
            for(int c = 0; c < to.length(); c++) {
                matrix[r][c] = new Cell();
            }
        }
    }

    private <T> void print(T out) {
        System.out.print(out);
    }

    private boolean getInput(Scanner input) {
        print("[Edit Distance]\n\n");

        print("Please enter the first string: ");
        this.from = input.nextLine();

        print("Please enter the second string: ");
        this.to = input.nextLine();

        return true;
    }

    public static void main(String[] args) {
        EditDistance editDistance = new EditDistance();
        editDistance.init();
    }

    public void init() {
        print("Edit Distance: " + compare(from, to) + "\n");
        print("Path: " + getPath());
        print("Matrix:\n");
        for(Cell[] row: matrix) {
            for(Cell cell : row) {
                if(cell != null) {
                    if (cell.cost < 10) {
                        print(cell.cost + "  ");
                    } else {
                        print(cell.cost + " ");
                    }
                }
            }
            print("\n");
        }
    }

    public int compare(String from, String to) {
        int[] costs = new int[3];

        for(int f = 1; f < from.length(); f++) {
            for(int t = 1; t < to.length(); t++) {
                costs[MATCH] = matrix[f-1][t-1].cost + cost(from, to, f, t);
                costs[INSERT] = matrix[f][t-1].cost + 1;
                costs[DELETE] = matrix[f-1][t].cost + 1;

                matrix[f][t].cost = costs[MATCH];
                matrix[f][t].type = MATCH;

                for(int i = INSERT; i < DELETE; i++) {
                    if(costs[i] < matrix[f][t].cost) {
                        matrix[f][t].cost = costs[i];
                        matrix[f][t].type = i;
                    }
                }
            }
        }

        return matrix[from.length() - 1][to.length() - 1].cost;
    }

    public int cost(String from, String to, int fromIndex, int toIndex) {
        if(from.charAt(fromIndex) == to.charAt(toIndex)) {
            return 0;
        }

        return 1;
    }

    public String getPath() {
        return "";
    }
}
